CREATE MATERIALIZED VIEW tensorzero.DynamicEvaluationRunByProjectNameView TO tensorzero.DynamicEvaluationRunByProjectName\n(\n    `run_id_uint` UInt128,\n    `variant_pins` Map(String, String),\n    `tags` Map(String, String),\n    `project_name` Nullable(String),\n    `run_display_name` Nullable(String),\n    `is_deleted` Bool,\n    `updated_at` DateTime64(6, \'UTC\')\n)\nAS SELECT *\nFROM tensorzero.DynamicEvaluationRun\nWHERE project_name IS NOT NULL\nORDER BY\n    project_name ASC,\n    run_id_uint ASC;
